import React, { Component } from 'react';
import IMG from '..\HighRadius...jpg';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    NavbarText
  } from 'reactstrap';
class NavbarComp extends Component {
    state = {  }
    render() { 
        return (  
            <div>
            <Navbar >
                <NavbarBrand href="/">{IMG}</NavbarBrand>
            </Navbar>
          </div>
        );
    }
}
 
export default NavbarComp;
